INSERT INTO `resolucion` VALUES (1,'Que en virtud de las Resoluciones No. 009 del 15 de enero de 2020 el seor Rector de la Universidad Distrital Francisco Jos de Caldas delega en el Decano de la Facultad de Medio Ambiente y Recursos Naturales la ordenacin del gasto y la contratacin para el rubro de Practicas Acadmicas Facultad del Medio Ambiente.','Que mediante Resolucin del Consejo Superior Universitario No. 004 del 4 de marzo de 2003, se establecen las escalas salariales de las distintas categoras de empleos de la Universidad Distrital Francisco Jos de Caldas y se dictan otras disposiciones.','Que en el artculo cuarto de la Resolucin de la Rectora No. 311 del 25 de junio de 2019, se establece que: para la realizacin de prcticas acadmicas, a los docentes de carrera y de vinculacin especial, slo se les podrn reconocer viticos, a 31 de diciembre de 2003, hasta por el valor de SESENTA Y CINCO MIL PESOS ($65.000) MC/TE por da pernoctado. Dicha suma, se reajustar anualmente en un porcentaje igual al incremento del ndice de Precios al Consumidor (1.P.C.) Nacional, que registre el DANE a 31 de diciembre de cada','Que mediante Resolucin de Rectora No. 311 del 25 de junio de 2019, se reglamenta el procedimiento general de solicitud de los avances, aprobacin, desembolso y su correspondiente legalizacin en la Universidad.','Que en el artculo tercero de la Resolucin de Rectora No. 311 del 25 de junio de 2019, se establecen las modalidades de avances.','Que en el artculo primero del Acuerdo 012 del 24 de octubre de 2019 el Consejo Superior modific el Artculo del Acuerdo No. 010 de 1988, en el cual determin que:','\"ARTCULO 2. Los estudiantes que deban realizar prcticas acadmicas fuera de la ciudad de Bogot en el territorio Nacional, segn la normatividad interna, recibirn un auxilio econmico equivalente al valor de uno punto dos (1.2) Salarios Mnimos Diarios Legales Mensuales Vigentes SMDLV, cuando la prctica sea por un solo  da.','En el caso que las prcticas sean por dos (2) o ms das, los estudiantes recibirn un auxilio econmico equivalente al valor de uno punto ocho 0.8) Salarios Mnimos Diarios Legales Mensuales Vigentes SMDLV, por cada uno de los das de prctica acadmica\"','Que se hace necesario autorizar el trmite de un avance a la Divisin Financiera de la Universidad Distrital Francisco Jos de Caldas, y as mismo el manejo y ejecucin del mismo a un docente de  la una actividad acadmica.','Que los planes de prcticas de los diferentes Proyectos Curriculares adscritos a la Facultad del Medio Ambiente y Recursos Naturales se aprobaron por el Consejo de Facultad mediante sesin del',NULL,'** El vitico de cada docente es de  (el nmero de das  0.5)  * $','El auxilio de cada estudiante  para prcticas de un da cuyo destino es fuera de la ciudad de Bogot es de $','El auxilio diario de cada estudiante  para prcticas de ms de un da cuyo destino es fuera de la ciudad de Bogot  es de $','Que el Decano de la Facultad del Medio Ambiente y Recursos Naturales en uso de sus facultades legales y especialmente las contempladas en el Articulo 91 del Acuerdo 11 de 2002, literal e, concede comisin para adelantar actividades relacionadas con su actividad acadmica al (los) docente(s) que participara(n) en la(s) prctica(s) acadmica(s) descrita es este acto administrativo','Delegar al citado docente para el manejo y legalizacin de los recursos entregados','La presente Resolucin rige a partir de la de fecha de su expedicin.');
